import React, { Component } from "react";

class Home extends Component {
  render() {
    return (
      <div>
        <h2>Welcome Numair Hussain!!</h2>
        <p>we will use this app to see different ways to deploy a React App </p>

        <p>This is a single page app using React</p>
      </div>
    );
  }
}

export default Home;
